import axios from 'axios';
import { Link, Outlet } from 'react-router-dom';

async function userList(){
  const userList = await axios.get('http://localhost:5000/users');
  console.log(userList.data);
  return userList;
}


async function getUser(id){
  const resp = await axios.get('http://localhost:5000/user/get/id');
  console.log(resp.data);
  return resp.data;
}

async function deleteUser(id){
  const resp = await axios.delete('http://localhost:5000/user/delete/id');
  console.log("User Deleted");
  console.log(resp.data);
  return resp.data;
}

async function getAllUsers(){
  const resp = await axios.get('http://localhost:5000/users/listAll');
  console.log("List All users API Response: ", resp.data);
}

const User = () =>{
  const username = "abcd"
  return (
    <>
      <ul>
        <li><Link to='/users/listAll'>List All Users</Link></li>
        <li><Link to={`/users/register`}>Register</Link></li>
        <li><Link to={`/users/getUser/${username}`}>Get Single User</Link></li>
        <li><Link to={`/users/updateUser/${username}`}>Update User</Link></li>
        <li><Link to={`/users/deleteUser/${username}`}>Delete User</Link></li>
      </ul>
      <Outlet />
    </>
  );
} 

export default User;
